import React, { useState } from 'react';
import './App.css';
import axios from 'axios';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import AdminSide from './AdminSide/AdminSide'
import Portal from './ClientSide/Portal'
import SinglePost from './AdminSide/SinglePost'
import Login from './AdminSide/Login';

function App() {

  return (
    <div className="App">
      <Router>
        <div>
          <Switch>
            <Route path="/admin">
              <AdminSide />
            </Route>

            <Route exact path="/">
              <Portal />
            </Route>
            <Route exact path="/admin/post/edit/:id" component={SinglePost} />
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
